WHERE planSustitucionId IN (
  SELECT id FROM planes_sustitucion 
  WHERE puestoClave != 'Si'
);

SELECT COUNT(*) as total_planes_sucesion FROM planes_sucesion;
SELECT COUNT(*) as total_puestos_clave FROM planes_sustitucion WHERE puestoClave = 'Si';

